import React, { Component } from "react";
import Axios from "axios";
//import ReactTable from "react-table";
//import "react-table/react-table.css";

export default class lawinfo extends Component {
  constructor() {
    super();
    this.state = {
      lawyer: [],
    };
  }

  componentDidMount = () => {
    const url = "/lawyersReporter";
    Axios.get(url).then((response) => {
      //console.log(response.data.tem_c);
      //console.log(response.data);
      fetch();
    });
  };

  render() {
    const columns = [
      {
        Header: "Employee ID",
        accessor: "employee_ID",
      },
      {
        Header: "First Name",
        accessor: "firstName",
      },
      {
        Header: "Last Name",
        accessor: "lastName",
      },
      {
        Header: "Grading",
        accessor: "barGrading",
      },
    ];
    return <ReactTable columns={columns}></ReactTable>;
  }
}
